export default function WeatherNext(props) {
  const { lat, long } = props;
  const fetch = async (e) => {
    e.preventDefault();
    const response = await axios.get(
      `https://api.openweathermap.org/data/2.5/onecall?lat=${lat}&lon=${lon}&appid=32ebd35073bbf5aae6c0b584c39472ce
      `
    );
    setWeather(response.data);
  };
  return <div>{lat}</div>;
}
